import Header from './Header';
import Order from './Order';
import Inventory from './Inventory';

class App extends React.Component {
    render() {
        return (
            <React.Fragment>
                <div className="catch-of-the-day">
                    <div className="menu">
                        <Header />
                    </div>
                    <Order />
                    <Inventory></Inventory>
                </div>
            </React.Fragment>
        )
    }

}

export default App;
